import './ErrorData.css'
import { Link } from 'react-router-dom';

function ErrorData () {

	return (
        <>
        <div className='black-background'>
            <div className="error-container">
                    <p>Oops! Something went wrong with our pokedex!<br/><br/>Please,come back a bit later and try again!</p>
                    
                    <Link to="/"><button className='error-button'>Back to home page</button></Link>
                    
                    <img src="/images/pikachu.png" alt="" />
            </div>
        </div>
        </>
    );
}

export default ErrorData;
